script: |
  super -f text -I q12793.spq | sort > q12793.out

inputs:
  - name: q12793.spq
    data: |
      SELECT col2 / col1 + - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - ( - col1 ) * + + col0 = + col1 + + col0 + col2 + - 74;
  - name: tab0

outputs:
  - name: q12793.out
    data: |
      -21
      -81
      98
